INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 2.1, 3001100, 130011, "2030/01/01 14:59:59", 3001, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", -416.5, 1, "ヤマト", 100, "2024/10/31 12:00:00", 2);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 5.68, 3001101, 130011, "2030/01/01 14:59:59", 3001, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", -416.5, 4, "ヤマト", 101, "2024/10/31 12:00:00", 2);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 0.0, 3001102, 130011, "2030/01/01 14:59:59", 3001, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", -416.5, 1, "ヤマト", 102, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 0.0, 3002100, 130211, "2030/01/01 14:59:59", 3002, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", -416.5, 1, "フブキ", 100, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 0.0, 3002101, 130211, "2030/01/01 14:59:59", 3002, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", -416.5, 1, "フブキ", 101, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 8.53, 3002102, 130211, "2030/01/01 14:59:59", 3002, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", -416.5, 5, "フブキ", 102, "2024/10/31 12:00:00", 2);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 5.67, 3002103, 130211, "2030/01/01 14:59:59", 3002, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", -416.5, 7, "フブキ", 103, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 0.0, 3002104, 130211, "2030/01/01 14:59:59", 3002, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", -416.5, 1, "フブキ", 104, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 0.0, 3002300, 130211, "2030/01/01 14:59:59", 3004, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", -416.5, 3, "フブキ", 300, "2024/10/31 12:00:00", 3);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 0.0, 3002400, 130211, "2030/01/01 14:59:59", 3005, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", -416.5, 7, "フブキ", 301, "2024/10/31 12:00:00", 7);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 4.4, 3003200, 130211, "2030/01/01 14:59:59", 3003, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", -416.5, 2, "フブキ", 200, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 0.0, 3003201, 130211, "2030/01/01 14:59:59", 3003, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", -416.5, 7, "フブキ", 201, "2024/10/31 12:00:00", 7);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (0.0, 5.6, 3003202, 130211, "2030/01/01 14:59:59", 3003, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", -416.5, 1, "フブキ", 202, "2024/10/31 12:00:00", 2);
